import math

def find_composite_numbers(n):

    def is_composite(num):
        if num <= 4:
            return False
        for i in range(2, int(math.sqrt(num)) + 1):
            if num % i == 0:
                return True
        return False
    composite_numbers = []
    for i in range(4, n + 1):
        if is_composite(i):
            composite_numbers.append(i)
    return composite_numbers

